import React from 'react';
import AppointmentForm from '../components/AppointmentForm';
import HealthTracking from '../components/HealthTracking';
import Blog from '../components/Blog';

const Home = () => (
  <div>
    <h2>Welcome to Our Healthcare App</h2>
    <AppointmentForm />
    <HealthTracking />
    <Blog />
  </div>
);

export default Home;
